- name: socks5
  type: group
  description: >
    SOCKS5 proxy related fields:

  fields:
    - name: rtt
      type: group
      description: >
        TLS layer round trip times.

      fields:
        - name: connect
          type: group
          description: >
            Time required to establish a connection via SOCKS5 to endpoint based on available connection to SOCKS5 proxy.

          fields:
            - name: us
              type: long
              description: Duration in microseconds
